  false,\n\t\"url\": null,\n\t\"notes\": \"This coverage contains polygons representing
  the Iowa Boundary, it was derived from a coverage of county boundaries, called COUNTIES,
  of the state of Iowa. COUNTIES was developed from a set of 99 individual coverages
  of the Public Land Survey System (PLSS) for each county in the state. The PLSS coverages
  were digitized from paper copies of 7.5' topographic quadrangle maps. River boundaries
  were also digitized from 7.5' maps.\",\n\t\"license_title\": null,\n\t\"extras\":
